import React from 'react';
import { NavLink } from 'react-router-dom';
import {  } from 'react-icons';

import '../../assect/css/mycss.css';
import { FaHome } from 'react-icons/fa';

class Navigation extends React.Component{
    render(){
        return(
            <dev className="sidenav">
                <ul>
                <li className="sidenav">
                    <FaHome /><NavLink to="/home">Home</NavLink></li>
                <li className="sidenav"><NavLink to="/user">User</NavLink></li>
                <li className="sidenav"><NavLink to="/root">Root</NavLink></li>
                </ul>

            </dev>
        );
    }
}

export default Navigation;
